import React from "react";

import UsersList from "../components/UsersList";

const Tasks = () => {
    const TASKS = [
        {
            id : 't1', 
            creator : 'Ananya Gupta', 
            tasks : {
                task1: 'Study JavaScript',
                task2: 'Go to Gym'
            }
        }
    ];
    return <UsersList items = {TASKS} />;
};

export default Tasks;
